import React from "react";
import "./style.css";

function Jumbotron() {
    return (
        <div className="jumbotron text-center">
            <h1>(React) Google Books Search</h1>
            <h3>Search for and Save Books of Interest</h3>
        </div>
    );
}

export default Jumbotron;
